// Block-matching algorithm
package main

// absolute value helper function
func abs(x float64) float64 {
	if x < 0.0 {
		return 0.0 - x
	}
	return x
}

func main() {
	// make 300 * 300 array to represent a bitmap
	var bigarray [300][300]float64
	var incvalue float64 = 0.0
	for i := 0; i < 300; i++ {
		for j := 0; j < 300; j++ {
			bigarray[i][j] = incvalue
			incvalue += 0.5
		}
	}

	// make 3 * 3 array to represent a matching block
	var match [3][3]float64
	var matchvalue float64 = 30.0
	for i := 0; i < 3; i++ {
		for j := 0; j < 3; j++ {
			match[i][j] = matchvalue
			matchvalue += 0.5
		}
	}

	// calculate error of a match, by sum of absolute differences of pixel intensities of 3 * 3
	// with loop unrolling 
	var error [298][298]float64
	for j := 0; j < 3; j++ {
		t0 := match[0][j]
		t1 := match[1][j]
		t2 := match[2][j]
		for y := 0; y <= 300-3; y++ {
			for x := 0; x <= 300-3; x++ {
				error[x][y] += abs(bigarray[x+0][y+j] - t0)
				error[x][y] += abs(bigarray[x+1][y+j] - t1)
				error[x][y] += abs(bigarray[x+2][y+j] - t2)
			}
		}
	}

	for i := 0; i < 298; i++ {
		// print("//~")
		for j := 0; j < 298; j++ {
			print(error[i][j], " ")
		}
		println()
	}

}
